import React from "react";

const Projects = props => {
  return (
    <div>
      {props.languages.map(item => (
        <div className="progress">
          <div
            className="progress-bar m-5"
            role="progressbar"
            style={{ width: "25%" }}
            aria-valuenow="25"
            aria-valuemin="0"
            aria-valuemax="100"
          >
            25%
          </div>
        </div>
      ))}
    </div>
  );
};

export default Projects;
